CREATE TABLE luis_sb(
   ID             INTEGER  NOT NULL PRIMARY KEY 
  ,Store_Name     VARCHAR(35) NOT NULL
  ,Street_Address VARCHAR(82) NOT NULL
  ,City           VARCHAR(29) NOT NULL
  ,StateProvince  VARCHAR(3) NOT NULL
  ,Country        VARCHAR(2) NOT NULL
  ,Longitude      NUMERIC(7,2) NOT NULL
  ,Latitude       NUMERIC(5,2) NOT NULL
);
